unt(*) |\r\n+----------+\r\n|        5 |\r\n+----------+\r\n1 row in set (0.000 sec)'),(7,'if (!$row) {\r\n\r\n    // Insert user \r\n    $insertuser = \'INSERT INTO tuser\r\n        (tusername, tpassword, tfirstname, tmiddle, tlastname,\r\n        tbirthday, temail, tage,tisregistereduser)\r\n    VALUES\r\n        (:username, :password, :firstname, :middle, :lastname,\r\n        :birthday, :email, :age, :isregistereduser)\';\r\n\r\n    $statement = $db->prepare($insertuser);\r\n    $statement->bindValue(\':username\', $lusername);\r\n    $statement->bindValue(\':password\', $lpassword);\r\n    $statement->bindValue(\':firstname\', $lfirstname);\r\n    $statement->bindValue(\':middle\', $lmiddle);\r\n    $statement->bindValue(\':lastname\', $llastname);\r\n    $statement->bindValue(\':birthday\', $lbirthday);\r\n    $statement->bindValue(\':email\', $lemail);\r\n    $statement->bindValue(\':age\', $lage);\r\n    $statement->bindValue(\':isregistereduser\', $lisregistereduser);'),(8,'if (!$row) {\r\n\r\n    // Insert user \r\n    $insertuser = \'INSERT INTO tuser\r\n        (tusername, tpassword, tfirstname, tmiddle, tlastname,\r\n        tbirthday, temail, tage,tisregistereduser)\r\n    VALUES\r\n        (:username, :password, :firstname, :middle, :lastname,\r\n        :birthday, :email, :age, :isregistereduser)\';\r\n\r\n    $statement = $db->prepare($insertuser);\r\n    $statement->bindValue(\':username\', $lusername);\r\n    $statement->bindValue(\':password\', $lpassword);\r\n    $statement->bindValue(\':firstname\', $lfirstname);\r\n    $statement->bindValue(\':middle\', $lmiddle);\r\n    $statement->bindValue(\':lastname\', $llastname);\r\n    $statement->bindValue(\':birthday\', $lbirthday);\r\n    $statement->bindValue(\':email\', $lemail);\r\n    $statement->bindValue(\':age\', $lage);\r\n    $statement->bindValue(\':isregistereduser\', $lisregistereduser);'),(9,'if (!$row) {\r\n\r\n    // Insert user \r\n    $insertuser = \'INSERT INTO tuser\r\n        (tusername, tpassword, tfirstname, tmiddle, tlastname,\r\n        tbirthday, temail, tage,tisregistereduser)\r\n    VALUES\r\n        (:username, :password, :firstname, :middle, :lastname,\r\n        :birthday, :email, :age, :isregistereduser)\';\r\n\r\n    $statement = $db->prepare($insertuser);\r\n    $statement->bindValue(\':username\', $lusername);\r\n    $statement->bindValue(\':password\', $lpassword);\r\n    $statement->bindValue(\':firstname\', $lfirstname);\r\n    $statement->bindValue(\':middle\', $lmiddle);\r\n    $statement->bindValue(\':lastname\', $llastname);\r\n    $statement->bindValue(\':birthday\', $lbirthday);\r\n    $statement->bindValue(\':email\', $lemail);\r\n    $statement->bindValue(\':age\', $lage);\r\n    $statement->bindValue(\':isregistereduser\', $lisregistereduser);'),(10,'if (!$row) {\r\n\r\n    // Insert user \r\n    $insertuser = \'INSERT INTO tuser\r\n        (tusername, tpassword, tfirstname, tmiddle, tlastname,\r\n        tbirthday, temail, tage,tisregistereduser)\r\n    VALUES\r\n        (:username, :password, :firstname, :middle, :lastname,\r\n        :birthday, :email, :age, :isregistereduser)\';\r\n\r\n    $statement = $db->prepare($insertuser);\r\n    $statement->bindValue(\':username\', $lusername);\r\n    $statement->bindValue(\':password\', $lpassword);\r\n    $statement->bindValue(\':firstname\', $lfirstname);\r\n    $statement->bindValue(\':middle\', $lmiddle);\r\n    $statement->bindValue(\':lastname\', $llastname);\r\n    $statement->bindValue(\':birthday\', $lbirthday);\r\n    $statement->bindValue(\':email\', $lemail);\r\n    $statement->bindValue(\':age\', $lage);\r\n    $statement->bindValue(\':isregistereduser\', $lisregistereduser);'),(11,'if (!$row) {\r\n\r\n    // Insert user \r\n    $insertuser = \'INSERT INTO tuser\r\n        (tusername, tpassword, tfirstname, tmiddle, tlastname,\r\n        tbirthday, temail, tage,tisregistereduser)\r\n    VALUES\r\n        (:username, :password, :firstname, :middle, :lastname,\r\n        :birthday, :email, :age, :isregistereduser)\';\r\n\r\n    $statement = $db->prepare($insertuser);\r\n    $statement->bindValue(\':username\', $lusername);\r\n    $statement->bindValue(\':password\', $lpassword);\r\n    $statement->bindValue(\':firstname\', $lfirstname);\r\n    $statement->bindValue(\':middle\', $lmiddle);\r\n    $statement->bindValue(\':lastname\', $llastname);\r\n    $statement->bindValue(\':birthday\', $lbirthday);\r\n    $statement->bindValue(\':email\', $lemail);\r\n    $statement->bindValue(\':age\', $lage);\r\n    $statement->bindValue(\':isregistereduser\', $lisregistereduser);'),(12,'if (!$row) {\r\n\r\n    // Insert user \r\n    $insertuser = \'INSERT INTO tuser\r\n        (tusername, tpassword, tfirstname, tmiddle, tlastname,\r\n        tbirthday, temail, tage,tisregistereduser)\r\n    VALUES\r\n        (:username, :password, :firstname, :middle, :lastname,\r\n        :birthday, :email, :age, :isregistereduser)\';\r\n\r\n    $statement = $db->prepare($insertuser);\r\n    $statement->bindValue(\':username\', $lusername);\r\n    $statement->bindValue(\':password\', $lpassword);\r\n    $statement->bindValue(\':firstname\', $lfirstname);\r\n    $statement->bindValue(\':middle\', $lmiddle);\r\n    $statement->bindValue(\':lastname\', $llastname);\r\n    $statement->bindValue(\':birthday\', $lbirthday);\r\n    $statement->bindValue(\':email\', $lemail);\r\n    $statement->bindValue(\':age\', $lage);\r\n    $statement->bindValue(\':isregistereduser\', $lisregistereduser);'),(13,'Prepared statements. Protection from SQL injections\r\nThis is the main and the only important reason why you were deprived from your beloved mysql_query() function and thrown into the harsh world of Data Objects: PDO has prepared statements support out of the box. Prepared statement is the only proper way to run a query, if any variable is going to be used in it. The reason why it is so important is explained in detail in The Hitchhiker\'s Guide to SQL Injection prevention.\r\n\r\nSo, for every query you run, if at least one variable is going to be used, you have to substitute it with a placeholder, then prepare your query, and then execute it, passing variables separately.\r\n\r\nLong story short, it is not as hard as it seems. In most cases, you need only two functions - prepare() and execute().\r\n\r\nFirst of all, you have to alter your query, adding placeholders in place of variables. Say, a code like this\r\n\r\n$sql = \"SELECT * FROM users WHERE email = \'$email\' AND status=\'$status\'\";\r\nwill become\r\n\r\n$sql = \'SELECT * FROM users WHERE email = ? AND status=?\';\r\nor\r\n\r\n$sql = \'SELECT * FROM users WHERE email = :email AND status=:status\';\r\nNote that PDO supports positional (?) and named (:email) placeholders, the latter always begins from a colon and can be written using letters, digits and underscores only. Also note that no quotes have to be ever used around placeholders.\r\n\r\nHaving a query with placeholders, you have to prepare it, using the PDO::prepare() method. This function will return the same PDOStatement object we were talking about above, but without any data attached to it.\r\n\r\nFinally, to get the query executed, you must run execute() method of this object, passing variables in it, in the form of array. And after that, you will be able to get the resulting data out of statement (if applicable):\r\n\r\n$stmt = $pdo->prepare(\'SELECT * FROM users WHERE email = ? AND status=?\');\r\n$stmt->execute([$email, $status]);\r\n$user = $stmt->fetch();\r\n// or\r\n$stmt = $pdo->prepare(\'SELECT * FROM users WHERE email = :email AND status=:status\');\r\n$stmt->execute([\'email\' => $email, \'status\' => $status]);\r\n$user = $stmt->fetch();\r\nAs you can see, for the positional placeholders, you have to supply a regular array with values, while for the named placeholders, it has to be an associative array, where keys have to match the placeholder names in the query. You cannot mix positional and named placeholders in the same query.\r\n\r\nPlease note that positional placeholders let you write shorter code, but are sensitive to the order of arguments (which have to be exactly the same as the order of the corresponding placeholders in the query). While named placeholders make your code more verbose, they allow random bindin'),(14,'mysqldump  --port=3306 --host=localhost -uroot  gravity_books   > books.sql'),(15,'mysqldump  --port=3306 --host=localhost -uroot  gravity_books   > books.sql'),(16,'mysqldump  --port=3306 --host=localhost -uroot  gravity_books   > books.sql'),(17,'\r\nPDO tutorial:  https://phpdelusions.net/pdo'),(18,'PDO..PDO tutorial\r\n\r\nhttps://phpdelusions.net/pdo'),(19,'PDO, PDO tutorial\r\n\r\nhttps://phpdelusions.net/pdo'),(20,'PDO, PDO tutorial'),(21,'PDO, PDO tutorial'),(22,'\r\nalliteration -The repetition of usually initial consonant sounds in two or more neighboring words or syllables --wild and woolly, threatening throngs\r\n fos anacoluthon  - Syntactical inconsistency or incoherence within a sentence especially : a shift in an unfinished sentence from one syntactic construction to another  --you really should have—well, what do you expect?\r\n fos anadiplosis  -Repetition of a prominent and usually the last word in one phrase or clause at the beginning of the next --rely on his honor—honor such as his?\r\n fos analepsis  -A literary technique that involves interruption of the chronological sequence of events by interjection of events or scenes of earlier occurrence : flashback\r\n fos  anaphora  -Repetition of a word or expression at the beginning of successive phrases, clauses, sentences, or verses especially for rhetorical or poetic effect --we cannot dedicate—we cannot consecrate—we cannot hallow—this ground\r\n fos antanaclasis  -The repetition of a word within a phrase or sentence in which the second occurrence utilizes a different and sometimes contrary meaning from the first --we must all hang together or most assuredly we shall all hang separately\r\n fos antiphrasis  -The usually ironic or humorous use of words in senses opposite to the generally accepted meanings --this giant of 3 feet 4 inches\r\n fos antonomasia  -The use of a proper name to designate a member of a class (such as a Solomon for a wise ruler) OR the use of an epithet or title in place of a proper name (such as the Bard for Shakespeare)\r\n fos apophasis  -The raising of an issue by claiming not to mention it --we won\'t discuss his past crimes\r\n fos aporia  -An expression of real or pretended doubt or uncertainty especially for rhetorical effect --to be, or not to be: that is the question\r\n fos cacophony  -Harshness in the sound of words or phrases\r\n fos chiasmus  -An inverted relationship between the syntactic elements of parallel phrases\r\n fos dialogism  -A disjunctive conclusion inferred from a single premise --gravitation may act without contact; therefore, either some force may act without contact or gravitation is not a force\r\n fos dysphemism  -The substitution of a disagreeable, offensive, or disparaging expression for an agreeable or inoffensive one --greasy spoon is a dysphemism for the word diner\r\n fos epistrophe  -Repetition of a word or expression at the end of successive phrases, clauses, sentences, or verses especially for rhetorical or poetic effect --of the people, by the people, for the people\r\n fos epizeuxis  -Emphatic repetition [this definition is taken from the 1934 edition of Webster\'s Unabridged dictionary]\r\n fos hypallage  -An interchange of two elements in a phrase or sentence from a more logical to a less logical relationship --you are lost to joy for joy is lost to you\r\n fos hyperbaton  -A transposition or inversion of idiomatic word order --judge me by my size, do you?\r\n fos hyperbole  -Extravagant exaggeration --mile-high ice-cream cones\r\n fos Hypophora  -The putting or answering of an objection or argument against the speaker\'s contention [this definition is taken from the 1934 edition of Webster\'s Unabridged dictionary]\r\n fos litotes  -Understatement in which an affirmative is expressed by the negative of the contrary --not a bad singer\r\n fos meiosis  -The presentation of a thing with underemphasis especially in order to achieve a greater effect : UNDERSTATEMENT\r\n fos metaphor  -A figure of speech in which a word or phrase literally denoting one kind of object or idea is used in place of another to suggest a likeness or analogy between them --drowning in money\r\n fos metonymy -A figure of speech consisting of the use of the name of one thing for that of another of which it is an attribute or with which it is associated -crown as used in lands belonging to the crown\r\n fos onomatopoeia  -The naming of a thing or action by a vocal imitation of the sound associated with it --buzz\r\n fos oxymoron  -A combination of contradictory or incongruous words -- cruel kindness\r\n fos pleonasm  -The use of more words than those necessary to denote mere sense : REDUNDANCY --I saw it with my own eyes\r\n fos Simile -A figure of speech comparing two unlike things that is often introduced by \"like\" or \"as\" --cheeks like roses\r\n fos syllepsis  -The use of a word in the same grammatical relation to two adjacent words in the context with one literal and the other metaphorical in sense --she blew my nose and then she blew my mind\r\n fos synecdoche  -A figure of speech by which a part is put for the whole (such as fifty sail for fifty ships), the whole for a part (such as society for high society), the species for the genus (such as cutthroat for assassin), the genus for the species (such as a creature for a man), or the name of the material for the thing made (such as boards for stage)\r\n fos zeugma  -The use of a word to modify or govern two or more words usually in such a manner that it applies to each in a different sense or makes sense with only one--opened the door and her heart to the homeless boy\r\n '),(23,'