DROP VIEW IF EXISTS vcontent;
CREATE VIEW `vcontent` ( vkey, vtext, vdatetime )
AS
  SELECT
    ckeys.kkey, ctext.ttext, ckeys.kdatetime
  FROM
    `ctext`, `ckeys`
  WHERE
    ckeys.kid = ctext.tid;
);

